import EventBus from './components/EventBus'

let gapi = window.gapi;


export default {
    loadGoogleAuth: () => {
        gapi.load('auth2', () => {
            gapi.auth2.init({
            client_id: '1052492048864-bae100u8h2h3rh1obk3fdpcaumem0e3t.apps.googleusercontent.com'
        })
        .then(res => {
            EventBus.$emit("google_auth_init", res)
        })
    });
    }
}
